import React from 'react';
import Product from "./Product";
import "./Cart.css";

const Cart = ({ cart }) => {

  return (
    <div className="Cart">
      <h2>Shopping Cart</h2>
      { cart.map(product => <Product product={ product } />) }
    </div>
  );
}

export default Cart;
